import React from "react";
import { Link } from "react-router-dom";

export default function Dashboard() {
  const fiches = [
    { id: 1, employe: "Rakoto", poste: "Comptable", periode: "2025-08", net: "1 200 000 Ar" },
    { id: 2, employe: "Randria", poste: "Technicien", periode: "2025-08", net: "950 000 Ar" }
  ];

  return (
    <div className="container">
      <div className="card">
        <h1>Tableau des fiches de paie</h1>
        {fiches.map((fiche) => (
          <div key={fiche.id} className="card">
            <h3>{fiche.employe} - {fiche.poste}</h3>
            <p>Période : {fiche.periode}</p>
            <p><strong>Salaire net :</strong> {fiche.net}</p>
          </div>
        ))}
        <br />
        <Link to="/" className="btn secondary">⬅ Retour accueil</Link>
      </div>
    </div>
  );
}
